import React from 'react';

function Header() {
  return (
    <header>
      <h1 style={headerStyle}>TodoList</h1>
    </header>
  );
}
const headerStyle = {
  background: '#333',
  color: '#fff',
  textAlign: 'center',
  paddind: '10px'
};
export default Header;
